import React from 'react';
import { useRootStore } from '../../store/rootStore';
import { observer } from "mobx-react";


const HomePage = observer(() => {
  const { store } = useRootStore();
  return (
    <div>
      <h1>Home Page</h1>
      <p>You are logged in!</p>
    </div>
  );
});

export default HomePage;
